import React from 'react';
import '../../styles/App.css';

const GreyBar = () =>{
    return(
      <div className = "greybar">
            <div id="round1"></div>
            <div id="round2"></div>
            <div id="round3"></div>
            </div>
    )
}

export default GreyBar;
